import './ExpenseForm.css';

const ExpenseForm = () => {
  return (
    <div className="new-expense__controls">
      <input className="new-expense__control" type="text" placeholder="Enter a new expense"/>
      <label className="new-expense__control">New Expense</label>
    </div>
 ) 
}

export default ExpenseForm;
